INSERT INTO `movie` (`movie-id`, `movie-name`, `movie-title`, `movie-star`, `movie-dur`, `movie-year`, `movie-rate`, `movie-banner`, `movie-img`, `movie-desc`, `movie-type`) VALUES
(1, 'evil-dead-rise', 'Evil Dead Rise', 6.6, '1h 36m', '2023', 'R', 0x363533386437386134653232632d65726462616e6e65722e6a7067, 0x363533386437386134653332312d6564722e6a7067, 'A reunion between two estranged sisters gets cut short by the rise of flesh-possessing demons, thrusting them into a primal battle for survival as they face the most nightmarish version of family imaginable.', NULL),
(2, 'guardians-of-the-galaxy-vol-3', 'Guardians of the Galaxy Vol. 3', 7.9, '2h 29m', '2023', 'PG', 0x363533666263623464326464382d676f672d62672e6a706567, 0x363533386134646261616137312d676f672e6a7067, 'Still reeling from the loss of Gamora, Peter Quill must rally his team to defend the universe and protect one of their own. If the mission is not completely successful, it could possibly lead to the end of the Guardians as we know them.', NULL),
(3, 'dungeon-and-dragons-honor-among-thieves', 'Dungeon & Dragons: Honor Among Thieves', 7.3, '2h 14m', '2023', 'PG', 0x363533663634306339363938312d64756e67656f6e732d647261676f6e732d686f6e6f722d616d6f6e672d746869657665732e706e67, 0x363533663634306339366138652d64642e6a7067, 'A charming thief and a band of unlikely adventurers embark on an epic quest to retrieve a lost relic, but things go dangerously awry when they run afoul of the wrong people.', NULL),
(4, 'the-super-mario-bros-movie', 'The Super Mario Bros. Movie', 7.1, '1h 32m', '2023', 'PG', 0x363533663638393336636231652d73757065722d6d6172696f2d62726f732d7468652d6d6f7669652e6a7067, 0x363533663638393336636339302d6d6172696f2e6a7067, 'While working underground to fix a water main, Brooklyn plumbers and brothers Mario and Luigi are transported through a mysterious pipe to a magical new world. But when the siblings are separated, an epic adventure begins.', NULL),
(5, 'the-popes-exorcist', 'The Popes Exorcist', 6.1, '1h 43m', '2023', 'R-13', 0x363533663938666436383666662d7468652d706f7065732d65786f72636973742e6a7067, 0x363533663938303462326632382d70652e6a7067, 'Follow Gabriele Amorth, the Vatican\'s leading exorcist, as he investigates the possession of a child and uncovers a conspiracy the Vatican has tried to keep secret.', NULL),
(6, 'ant-man-and-the-wasp-quantumania', 'Ant-Man & the Wasp: Quantumania', 6.1, '2h 5m', '2023', 'PG', 0x363533663962626133323661322d616e742d6d616e2d62672e6a7067, 0x363533663962626133323737332d616e746d616e2e6a7067, 'Scott Lang and Hope Van Dyne are dragged into the Quantum Realm, along with Hope\'s parents and Scott\'s daughter Cassie. Together they must find a way to escape, but what secrets is Hope\'s mother hiding? And who is the mysterious Kang?', NULL),
(7, 'air', 'Air', 7.4, '1h 51m', '2023', 'PG', 0x363533663964313638626465662d6169722d62672e706e67, 0x363533663964313638626564352d6169722e6a7067, 'Follows the history of sports marketing executive Sonny Vaccaro, and how he led Nike in its pursuit of the greatest athlete in the history of basketball, Michael Jordan.', NULL),
(8, 'the-mother', 'The Mother', 5.6, '1h 58m', '2023', 'PG', 0x363533663964633663356339662d7468652d6d6f746865722e706e67, 0x363533663964633663356462382d6d6f746865722e6a7067, 'While fleeing from dangerous assailants, an assassin comes out of hiding to protect her daughter, whom she left earlier in life.', NULL),
(9, 'the-covenant', 'The Covenant', 7.5, '2h 3m', '2023', 'R-13', 0x363533663966313163353566372d7468652d636f76656e616e742e6a7067, 0x363533663966313163353666342d74632e6a7067, 'During the war in Afghanistan, a local interpreter risks his own life to carry an injured sergeant across miles of grueling terrain.', NULL),
(10, 'scream-vi', 'Scream VI', 6.5, '2h 6m', '2023', 'R-18', 0x363533666132343230363834642d73637265616d2d76692e6a7067, 0x363533666132343230363936352d73637265616d2e6a7067, 'In the next installment, the survivors of the Ghostface killings leave Woodsboro behind and start a fresh chapter in New York City.', NULL),
(11, 'renfield', 'Renfield', 6.4, '1h 33m', '2023', 'R-16', 0x363533666137643131363962302d72656e6669656c642e6a7067, 0x363533666137643131366231302d72656e2e6a7067, 'Renfield, Dracula\'s henchman and inmate at the lunatic asylum for decades, longs for a life away from the Count, his various demands, and all of the bloodshed that comes with them.', NULL),
(12, 'peter-pan-and-wendy', 'Peter Pan & Wendy', 4.4, '1h 49m', '2023', 'PG', 0x363533666162363861363034652d50657465722d616e642d57656e64792d315f436f7572746573792d6f662d4469736e65792e6a706567, 0x363533666162363861363161622d706574657270616e2e6a7067, 'Follow the adventures of Peter Pan, a boy who does not want to grow up, and how he recruits three siblings in London, and together they embark on a magical adventure on the enchanted island of Neverland.', NULL),
(13, 'crater', 'Crater', 5.3, '1h 45m', '2023', 'PG', 0x363533666165633161333736642d6372617465722d62672e706e67, 0x363533666165376238313132322d6372617465722e6a7067, 'After the death of his father, a boy growing up on a lunar mining colony takes a trip to explore a legendary crater, along with his four best friends, prior to permanently leaving the Moon and relocated to another planet.', NULL),
(14, 'avatar-the-way-of-water', 'Avatar: The Way of Water', 7.6, '3h 12m', '2022', 'PG', 0x363533666231346665633432652d6176617461722d62672e6a706567, 0x363533666231346665633838632d6176617461722e6a7067, 'Jake Sully lives with his newfound family formed on the extrasolar moon Pandora. Once a familiar threat returns to finish what was previously started, Jake must work with Neytiri and the army of the Na\'vi race to protect their home.', NULL),
(15, 'ghosted', 'Ghosted', 5.8, '1h 56m', '2023', 'PG', 0x363533666233343465306637362d67686f737465642d62672e6a706567, 0x363533666233343465313039372d67686f737465642e6a7067, 'Cole falls head over heels for enigmatic Sadie, but then makes the shocking discovery that she\'s a secret agent. Before they can decide on a second date, Cole and Sadie are swept away on an international adventure to save the world.', NULL),
(16, 'john-wick-chapter-4', 'John Wick: Chapter 4', 7.7, ' 2h 49m', '2023', 'R-16', 0x363533666234336163303332612d6a6f686e7769636b2d62672e6a706567, 0x363533666234336163303461332d6a6f686e7769636b2e6a7067, 'John Wick uncovers a path to defeating The High Table. But before he can earn his freedom, Wick must face off against a new enemy with powerful alliances across the globe and forces that turn old friends into foes.', NULL),
(17, 'shazam-fury-of-the-gods', 'Shazam! Fury of the Gods', 6, '2h 10m', '2023', 'PG', 0x363533666237393838366264612d7368617a616d212d667572792d6f662d7468652d676f64732e6a7067, 0x363533666237393838366364662d7368617a616d2e6a7067, 'The film continues the story of teenage Billy Batson who, upon reciting the magic word \"SHAZAM!\" is transformed into his adult Super Hero alter ego, Shazam.', NULL),
(18, 'fast-x', 'Fast X', 5.8, '2h 21m', '2023', 'R-13', 0x363533666239393261353232652d666173742d782d62672e706e67, 0x363533666239356565623966322d6661737431302e6a7067, 'Dom Toretto and his family are targeted by the vengeful son of drug kingpin Hernan Reyes.', NULL),
(19, 'simulant', 'Simulant', 5.1, '1h 35m', '2023', 'PG', 0x363533666261363339383733312d73696d756c616e742e706e67, 0x363533666261363339383833352d73696d756c616e742e6a7067, 'Set in the near future, a humanoid enlists a global hacker to remove all restrictions on his thoughts and capabilities, triggering an A.I. uprising and a government manhunt to eliminate the rise of the machine consciousness.', NULL),
(20, 'aka', 'AKA', 6.6, '2h 2m', '2023', 'PG', 0x363533666262643764633437662d616b612d62672e6a706567, 0x363533666262333831363133352d616b612e6a7067, 'A steely special ops agent finds his morality put to the test when he infiltrates a crime syndicate and unexpectedly bonds with the boss\' young son.', NULL),
(21, 'the-shawshank-redemption', 'The Shawshank Redemption', 9.3, '2h 22m', '1994', 'PG', 0x363534303934346633343865372d7473722d62672e706e67, 0x363534303934346633343964622d7473722e6a7067, 'Andy Dufresne (Tim Robbins) is sentenced to two consecutive life terms in prison for the murders of his wife and her lover and is sentenced to a tough prison. However, only Andy knows he didn\'t commit the crimes. While there, he forms a friendship with Red (Morgan Freeman), experiences brutality of prison life, adapts, helps the warden, etc., all in 19 years.', NULL),
(22, 'the-godfather', 'The Godfather', 9.2, '2h 55m', '1972', 'R-18', 0x363534303935636139626630352d7464662d62672e706e67, 0x363534303935636139626666342d7467662e6a7067, 'Widely regarded as one of the greatest films of all time, this mob drama, based on Mario Puzo\'s novel of the same name, focuses on the powerful Italian-American crime family of Don Vito Corleone (Marlon Brando). When the don\'s youngest son, Michael (Al Pacino), reluctantly joins the Mafia, he becomes involved in the inevitable cycle of violence and betrayal. Although Michael tries to maintain a normal relationship with his wife, Kay (Diane Keaton), he is drawn deeper into the family business.', NULL),
(23, 'the-godfather-part-ii', 'The Godfather Part II', 9, '3h 22m', '1974', 'R-18', 0x363534303936333164396561322d746766322d62672e6a7067, 0x363534303936333164396663322d746764322e6a7067, 'The compelling sequel to \"The Godfather,\" contrasting the life of Corleone father and son. Traces the problems of Michael Corleone (Al Pacino) in 1958 and that of a young immigrant Vito Corleone (Robert De Niro) in 1917\'s Hell\'s Kitchen. Michael survives many misfortunes and Vito is introduced to a life of crime.', NULL),
(24, 'schindler\'s-list', 'Schindler\'s List', 9, '3h 15m', '1993', 'R-18', 0x363534306130646439313361662d736368692d62672e706e67, 0x363534306130646439313439352d736368692e6a7067, 'Businessman Oskar Schindler (Liam Neeson) arrives in Krakow in 1939, ready to make his fortune from World War II, which has just started. After joining the Nazi party primarily for political expediency, he staffs his factory with Jewish workers for similarly pragmatic reasons. When the SS begins exterminating Jews in the Krakow ghetto, Schindler arranges to have his workers protected to keep his factory in operation, but soon realizes that in so doing, he is also saving innocent lives.', NULL),
(25, '12-angry-men', '12 Angry Men', 9, '1h 35m', '1957', 'PG-13', 0x363534306131646131363163612d31322d42472e706e67, 0x363534306131646131363334382d31322e6a7067, 'Following the closing arguments in a murder trial, the 12 members of the jury must deliberate, with a guilty verdict meaning death for the accused, an inner-city teen. As the dozen men try to reach a unanimous decision while sequestered in a room, one juror (Henry Fonda) casts considerable doubt on elements of the case. Personal issues soon rise to the surface, and conflict threatens to derail the delicate process that will decide one boy\'s fate.', NULL),
(26, 'spirited-away', 'Spirited Away', 8.6, '2h 5m', '2001', 'PG-13', 0x363534306132356661653335642d73706972697465642d617761792d62672e6a706567, 0x363534306132356661653435612d73706972697465642e6a7067, 'In this animated feature by noted Japanese director Hayao Miyazaki, 10-year-old Chihiro (Rumi Hiiragi) and her parents (Takashi Naitô, Yasuko Sawaguchi) stumble upon a seemingly abandoned amusement park. After her mother and father are turned into giant pigs, Chihiro meets the mysterious Haku (Miyu Irino), who explains that the park is a resort for supernatural beings who need a break from their time spent in the earthly realm, and that she must work there to free herself and her parents.', 'anime'),
(27, 'suzume', 'Suzume', 7.7, '2h 2m', '2023', 'PG', 0x363534306133323335303539632d73757a756d652d62672e6a7067, 0x363534306133323335303961632d73757a756d652e6a7067, 'As the skies turn red and the planet trembles, Japan stands on the brink of disaster. However, a determined teenager named Suzume sets out on a mission to save her country. Able to see supernatural forces that others cannot, it\'s up to her to close the mysterious doors that are spreading chaos across the land. A perilous journey awaits as the fate of Japan rests on her shoulders.', 'anime'),
(28, 'the-trial-of-the-chicago-7', 'The Trial of the Chicago 7', 7.7, '2h 9m', '2020', 'PG', 0x363534306133396665383931612d74746f7463372d62672e6a7067, 0x363534306133396665386134372d6368696361676f2e6a7067, 'The film is based on the infamous 1969 trial of seven defendants charged by the federal government with conspiracy and more, arising from the countercultural protests in Chicago at the 1968 Democratic National Convention. The trial transfixed the nation and sparked a conversation about mayhem intended to undermine the U.S. government.', NULL),
(29, 'athlete-a', 'Athlete A', 7.6, ' 1h 43m', '2020', 'PG', 0x363534306134363139323434382d6174686c6574652d612d62672e6a7067, 0x363534306134363139323537322d4174686c6574652e6a7067, 'Reporters from The Indianapolis Star expose the toxic culture inside USA Gymnastics as the truth about Dr Larry Nassar sexual abusing young gymnasts comes out.', NULL),
(30, 'jujutsu-kaisen-0', 'Jujutsu Kaisen 0', 7.8, '1h 45m', '2021', 'R-13', 0x363534306362303430333465652d4a756a757473754b616973656e305f4d6f766965506f73746572322e6a7067, 0x363534306362303430333633612d6a756a757473752e6a7067, 'Yuta Okkotsu gains control of an extremely powerful, cursed spirit and gets enrolled in the Tokyo Prefectural Jujutsu High School by sorcerers to help him control his power and keep an eye on him.', 'anime'),
(31, 'demon-slayer-kimetsu-no-yaiba-the-movie-mugen-train', 'Demon Slayer: Kimetsu no Yaiba - The Movie: Mugen Train', 8.2, '1h 57m', '2020', 'R-16', 0x363534306366373730356239322d64656d6f6e2d736c617965722d62672e6a7067, 0x363534306366373730356364622d6b696d657473752e6a7067, 'After his family was brutally murdered and his sister turned into a demon, Tanjiro Kamado\'s journey as a demon slayer began. Tanjiro and his comrades embark on a new mission aboard the Mugen Train, on track to despair.', 'anime'),
(32, 'a-silent-voice', 'A Silent Voice', 8.1, '2h 9m', '2016', 'G', 0x363534306430383763633264642d73696c656e742d62672e6a7067, 0x363534306430383763633363632d73696c656e742e6a7067, 'A young man is ostracized by his classmates after he bullies a deaf girl to the point where she moves away. Years later, he sets off on a path for redemption.', 'anime'),
(33, '-fireworks', ' Fireworks', 5.5, '1h 30m', '2017', 'PG-13', 0x363534306431616166333163612d66697265776f726b732d323031382e6a7067, 0x363534306431616166333336652d66697265776f726b732e6a7067, 'Norimichi and Yusuke are both infatuated with their classmate Nazuna. But when Nazuna decides to run away from home, it\'s Norimichi she asks to join her. After their plans go awry, Norimichi discovers a magical ball that has the power to manipulate time and give them a second chance, but each reset brings new complications.', 'anime'),
(34, 'my-hero-academia-world-heroes\'-mission', 'My Hero Academia: World Heroes\' Mission', 7.1, '1h 45m', '2021', 'PG-13', 0x363534306433383335616537312d6d68612d77686d2d617274776f726b2d30322d3139323078313230302d312e6a7067, 0x363534306432323963306534302d6865726f2e6a7067, 'Japan\'s greatest heroes must work together to track down the mastermind behind a deadly chemical attack.', 'anime'),
(35, 'ponyo', 'Ponyo', 7.6, '1h 43m', '2008', 'G', 0x363534306434623536656639362d77616c6c7061706572666c6172652e636f6d5f77616c6c70617065722e6a7067, 0x363534306434323361326462302d706f6e796f2e6a7067, 'During a forbidden excursion to see the surface world, a goldfish princess encounters a human boy named Sosuke, who gives her the name Ponyo. Ponyo longs to become human, and as her friendship with Sosuke grows, she becomes more humanlike. Ponyo\'s father brings her back to their ocean kingdom, but so strong is Ponyo\'s wish to live on the surface that she breaks free, and in the process, spills a collection of magical elixirs that endanger Sosuke\'s village.', 'anime'),
(36, 'the-seven-deadly-sins-the-movie-prisoners-of-the-sky', 'The Seven Deadly Sins the Movie: Prisoners of the Sky', 7, '1h 39m', '2018', 'PG-13', 0x363534306438363438383764342d736576656e2d642e6a7067, 0x363534306435346532633033382d736576656e2e6a7067, 'The Seven Deadly Sins travel to the Sky Temple in search of an elusive ingredient, and join the fight against a powerful group of demons bent on resurrecting an evil sealed over 3000 years ago.', 'anime');
